    <div>
      <h1>Hello world !!</h1>
      <Expense items={expensee_data} onExpHandler={expHandler} />
      {/* <ExpenseItems
      title={expensee_data[0].title} 
      amount={expensee_data[0].amount} 
      date={expensee_data[0].date} 
      /> */}
    </div>
  );
}

export default App;
